import { types } from "./types";

export default function html(data: {
    title: string
    js: string
    css: string
    notes: types.Note[]
}) {
    return (
        `<!DOCTYPE html>
<html lang="en">
<head>

<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<meta http-equiv="X-UA-Compatible" content="ie=edge">

<link rel="shortcut icon"type="image/x-icon" href="data:image/png;base64," />

<title>${data.title}</title>
<meta name="description" content="${data.title} - built with npmnotes" />

<meta property="og:title" content="${data.title}" />
<meta property="og:image" content="data:image/png;base64," />
<meta property="og:description" content="${data.title} - built with npmnotes" />

<style>${data.css}</style>
<script>const data = ${JSON.stringify(data.notes)}</script>
</head>

<body>
<script type="module">${data.js}</script>
<input id='dummy-input' type="text">


<div id='main' class='row'>
    <div id='left' class='column'>
        <div id='search-box' class='row'>
            <i class='fa fa-search flex-align-center'></i>
            <input id='search' type="search" class='flex-grow' />
        </div>
        <div id='left-root' class='flex-grow scroll'></div>
    </div>
    <div id='right-root' class='flex-grow scroll'></div>
</div>

</body>
</html>`
    )
}